import Head from 'next/head';

let logoStyle = {
    maxHeight:'40px'
}

const Header = props => (
    <div>
            <Head>
        <title>Yernemm{props.title ? " - " + props.title : ""}</title>
    </Head>
        <h1><img src="/static/media/image/snowballAnim.gif" style={logoStyle} />Yernemm{props.title ? " - " + props.title : ""}</h1>
        <hr />
    </div>
)

export default Header;
